import React from 'react';
import './Gym.css';
import Footer from '../Footer/Footer';
import Barra from '../Navbar/Navbar';
import Buscar from '../Img/2811790.png';
import { ButtonToolbar, ButtonGroup, Button, InputGroup, FormControl } from 'react-bootstrap';

export const Gym = () => {
  return (
  
  <div>
      <Barra />
      <div className='barraBuscar'>
<ButtonToolbar
    className="justify-content-between"
    aria-label="Toolbar with Button groups"
  >
    <ButtonGroup aria-label="First group">
    <Button variant="outline-secondary" href='/Equipo'>TODOS</Button>{' '}
    <Button variant="outline-secondary" href='/Equipo/Calistenia'>CALISTENIA</Button>{' '}
    <Button variant="outline-secondary" href='/Equipo/Gym'>GYM</Button>{' '}
    </ButtonGroup>
    <InputGroup>
      <FormControl
        type="text"
        placeholder="Buscar"
        aria-label="Buscar"
        aria-describedby="btnGroupAddon2"
      />
      <Button variant="outline-secondary" href=''>
      <img
        className="buscar"
        src={Buscar}
      />
      </Button>{' '}
      </InputGroup>
  </ButtonToolbar>
</div>
      <div>
          <h1>GYM</h1>
      </div>
      <Footer />
  </div>
    );
};

export default Gym;
